import './Modal.css';

const Modal = () => {
    return (
    <div>
    <Modal>
        <Tabs value={value} onChange={handleChange} aria-label="basic tabs example">
           <Tab label="Item One"/>
           <Tab label="Item Two" />
           <Tab label="Item Three" />
        </Tabs>
    </Modal>
    </div>
  );
};

export default Modal;
